      SELECT - - 33 - + 48 * + 36 FROM tab1 (FORMAT parquet) WHERE NOT col1 BETWEEN - - col0 AND CAST ( NULL AS INTEGER ) * + 77 * + + col1 + + + col2;
  - name: tab1

outputs:
  - name: q1191.out
    data: |
      -1695
      -1695
      -1695
